import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'


/**
 * 
 */
const footerMain = {
    backgroundColor: "black",
    padding: "3em",
    color: "#02FFFF",
    position: "absolute",
    width: "100%",
    bottom: "0",
    display: "flex",
    justifyContent: "center",
    fontFamily: "sans-serif",
    fontStyle: "normal"
}

const linkInStyle = {
    fontFamily: "sans-serif",
    fontStyle: "normal",
    border: "1px solid #02FFFF",
    fontWeight: "900",
    padding: "1px 7px",
    fontSize: "30px"
}

const Footer = () => {
    return <footer style={footerMain}>
        <a href="https://icons8.com/icon/12599/github"></a>
        <img src="https://img.icons8.com/ios-filled/50/000000/github.png" />
        <i className="material-icons" style={{ fontSize: '36px' }}>share</i>
        <img src="https://img.icons8.com/small/32/000000/linkedin.png" />
        <i style={linkInStyle}>in</i>
    </footer>;
}


// #endregion

export default Footer;
